import React from 'react';

const CareerAddonsSection: React.FC = () => {
  const addons = [
    {
      id: 1,
      title: 'Resume Prep',
      description: 'Professional resume crafting with ATS optimization and industry-specific templates',
      icon: 'ðŸ“„',
      features: ['ATS-friendly format', 'Industry templates', 'Expert review', 'Multiple versions']
    },
    {
      id: 2,
      title: 'LinkedIn & Naukri Optimization',
      description: 'Optimize your professional profiles to attract top recruiters and opportunities',
      icon: 'ðŸ”—',
      features: ['Profile optimization', 'Keyword strategy', 'Network building', 'Content guidance']
    },
    {
      id: 3,
      title: 'Technical + HR Interview Prep',
      description: 'Comprehensive interview preparation covering both technical skills and soft skills',
      icon: 'ðŸŽ¯',
      features: ['Mock interviews', 'Technical questions', 'HR scenarios', 'Feedback sessions']
    },
    {
      id: 4,
      title: '1-on-1 Review Meetings',
      description: 'Personalized mentoring sessions with industry experts and career coaches',
      icon: 'ðŸ‘¥',
      features: ['Personal mentoring', 'Career guidance', 'Skill assessment', 'Goal setting']
    },
    {
      id: 5,
      title: 'Job Placement Support',
      description: 'Direct placement assistance with our network of 500+ hiring companies',
      icon: 'ðŸš€',
      features: ['Direct referrals', 'Interview scheduling', 'Salary negotiation', 'Onboarding support']
    }
  ];

  return (
    <section id="career-addons" className="py-20 bg-grafanaBg">
      <div className="container mx-auto px-4">
        {/* Section Header */}
        <div className="text-center mb-16">
          <h2 className="text-4xl md:text-5xl font-display font-bold mb-6">
            <span className="bg-gradient-to-r from-white to-gray-300 bg-clip-text text-transparent">
              Career Success
            </span>
            <br />
            <span className="bg-gradient-to-r from-grafanaGreen to-grafanaOrange bg-clip-text text-transparent">
              Add-ons
            </span>
          </h2>
          <p className="text-xl text-gray-300 max-w-3xl mx-auto">
            Beyond technical skills, we provide comprehensive career support to ensure your success in the job market.
          </p>
        </div>

        {/* Add-ons Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {addons.slice(0, 3).map((addon) => (
            <div
              key={addon.id}
              className="bg-grafanaGray rounded-xl p-8 border border-gray-700 hover:border-grafanaGreen/50 transition-all duration-300 hover:transform hover:scale-105 group relative overflow-hidden"
            >
              {/* Background gradient on hover */}
              <div className="absolute inset-0 bg-gradient-to-br from-grafanaGreen/5 to-grafanaBlue/5 opacity-0 group-hover:opacity-100 transition-opacity duration-300"></div>

              {/* Content */}
              <div className="relative z-10">
                {/* Icon */}
                <div className="w-16 h-16 rounded-xl bg-gradient-to-r from-grafanaGreen to-grafanaBlue flex items-center justify-center text-2xl mb-6 group-hover:scale-110 transition-transform duration-300">
                  {addon.icon}
                </div>

                {/* Title */}
                <h3 className="text-2xl font-semibold text-white mb-4 group-hover:text-grafanaGreen transition-colors duration-300">
                  {addon.title}
                </h3>

                {/* Description */}
                <p className="text-gray-400 mb-6 leading-relaxed">
                  {addon.description}
                </p>

                {/* Features */}
                <ul className="space-y-2">
                  {addon.features.map((feature, index) => (
                    <li key={index} className="flex items-center text-sm text-gray-300">
                      <svg className="w-4 h-4 text-grafanaGreen mr-3 flex-shrink-0" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M5 13l4 4L19 7" />
                      </svg>
                      {feature}
                    </li>
                  ))}
                </ul>
              </div>

              {/* Hover border effect */}
              <div className="absolute inset-0 rounded-xl border-2 border-transparent group-hover:border-grafanaGreen/30 transition-all duration-300"></div>
            </div>
          ))}
        </div>

        {/* CTA */}
        <div className="text-center mt-16">
          <div className="bg-grafanaGray rounded-2xl p-8 border border-grafanaGreen/30 max-w-2xl mx-auto">
            <h3 className="text-2xl font-semibold text-white mb-4">
              Ready to Accelerate Your Career?
            </h3>
            <p className="text-gray-300 mb-6">
              Get access to all career add-ons and personalized support to land your dream job.
            </p>
            <button className="bg-gradient-to-r from-grafanaGreen to-grafanaBlue text-white px-8 py-4 rounded-full text-lg font-semibold hover:shadow-grafana transition-all duration-300 transform hover:scale-105">
              Get Career Support
            </button>
          </div>
        </div>
      </div>
    </section>
  );
};

export default CareerAddonsSection;
